// check positivity of cell average and control nodes
bool check(const double *fIn, int ndim, int polyOrder, int *idx, double tCurr, int rkIdx)
{
  double f0 = fIn[0]*std::pow(0.7071067811865475,ndim);
  bool status = true;

  if(f0 < 0.) {
     if(ndim == 1) {
       printf("WARNING: negative cell avg %e in cell %2d, tCurr = %e\n", f0, idx[0], tCurr);
     } else if( ndim == 2) {
       printf("WARNING: negative cell avg %e in cell %2d %2d, tCurr = %e, rkIdx = %d\n", f0, idx[0], idx[1], tCurr, rkIdx);
     } else if( ndim == 3) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], idx[2], tCurr);
     } else if( ndim == 4) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], idx[2], idx[3], tCurr);
     } else if( ndim == 5) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d %2d %2d, tCurr = %e, rkIdx = %d\n", f0, idx[0], idx[1], idx[2], idx[3], idx[4], tCurr, rkIdx);
     }
     status = false;
  }

  double fmin = findMinNodalValue(fIn, ndim, polyOrder);
  if (fmin < 0.0 && status) {
     if(ndim == 1) {
       printf("warning: negative control node %e in cell %2d, tCurr = %e \n", fmin, idx[0], tCurr);
     } else if(ndim == 2) {
       printf("warning: negative control node %e in cell %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], tCurr);
     } else if(ndim == 3) {
       printf("warning: negative control node %e in cell %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], tCurr);
     } else if(ndim == 4) {
       printf("warning: negative control node %e in cell %2d %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], idx[3], tCurr);
     } else if(ndim == 5) {
       printf("warning: negative control node %e in cell %2d %2d %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], idx[3], idx[4], tCurr);
     }
  }
  return status;
}


double rescale(const double *fIn, double *fOut, int ndim, int polyOrder, int numBasis, int *idx, double tCurr)
{
  double f0 = fIn[0]*std::pow(0.7071067811865475,ndim);
  if (f0 < 0.) {
     if(ndim == 1) {
       printf("WARNING: negative cell avg %e in cell %2d, tCurr = %e\n", f0, idx[0], tCurr);
     } else if( ndim == 2) {
       printf("WARNING: negative cell avg %e in cell %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], tCurr);
     } else if( ndim == 3) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], idx[2], tCurr);
     } else if( ndim == 4) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], idx[2], idx[3], tCurr);
     } else if( ndim == 5) {
       printf("WARNING: negative cell avg %e in cell %2d %2d %2d %2d %2d, tCurr = %e\n", f0, idx[0], idx[1], idx[2], idx[3], idx[4], tCurr);
     }
     return 0.;
  }

  double fmin = findMinNodalValue(fIn, ndim, polyOrder);
  double fminOld, del2Change = 0.;
  int j = 0;

  while (j<10 && fmin < 0.0) {
     double theta = std::min(1.0, (1. - EPSILON)/(1. - fmin/f0 + EPSILON));
     //double theta = std::min(1.0, f0/(f0 - fmin + EPSILON));

     // modify moments. note no change to cell average
     fOut[0] = fIn[0]; 
     double del2 = 0.0;
     for(int i=1; i<numBasis; i++) {
       if(theta < 1 && j==0) {
          del2 += fIn[i]*fIn[i];
          fOut[i] = theta*fIn[i];
       } else {
          fOut[i] = theta*fOut[i];
       }
     }
     del2Change += del2*(1-theta)*(1-theta);
     
     fmin = findMinNodalValue(fOut, ndim, polyOrder);
     j++;
  }

  if (fmin < 0.0) {
     if(ndim == 1) {
       printf("warning: negative control node %e in cell %2d, tCurr = %e \n", fmin, idx[0], tCurr);
     } else if(ndim == 2) {
       printf("warning: negative control node %e in cell %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], tCurr);
     } else if(ndim == 3) {
       printf("warning: negative control node %e in cell %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], tCurr);
     } else if(ndim == 4) {
       printf("warning: negative control node %e in cell %2d %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], idx[3], tCurr);
     } else if(ndim == 5) {
       printf("warning: negative control node %e in cell %2d %2d %2d %2d %2d, tCurr = %e\n", fmin, idx[0], idx[1], idx[2], idx[3], idx[4], tCurr);
     }
  }
  
  return del2Change;
}

double calcVolTermRescale(const double tCurr, const double dt, const double *fIn, const double weight, const double *fRhsSurf, double *fRhsVol, int ndim, int polyOrder, int numBasis, int *idx, int printWarnings)
{
  double fOutSurf[numBasis];
  for(int i=0; i<numBasis; i++) {
    fOutSurf[i] = weight/dt*fIn[i] + fRhsSurf[i];
  }

  double minOutSurf = findMinNodalValue(fOutSurf, ndim, polyOrder);
  double f0 = fOutSurf[0]*pow(0.7071067811865475, ndim);
 
  if (printWarnings && (dt*minOutSurf < -EPSILON*dt*abs(minOutSurf-2*f0)-DBL_MIN)) {
    printf("warning: at time %g, surface terms making control node negative, with value = %g in cell = (%d", tCurr, dt*minOutSurf, idx[0]);
    for(int i=1; i<ndim; i++) {
      printf(", %d", idx[i]);
    }
    printf("), weight = %f \n", weight);
  }

  double scaler = findMinNodalRatio(fOutSurf, fRhsVol, 1.0, ndim, polyOrder);
  if(scaler < 0.) scaler = 0.;
  if(scaler < 1.) scaler *= .95;

  return scaler;
}

double rescaleVolTerm(const double tCurr, const double dt, const double *fIn, const double weight, const double *fRhsSurf, double *fRhsVol, int ndim, int polyOrder, int numBasis, int *idx, int printWarnings)
{

  double scaler = calcVolTermRescale(tCurr, dt, fIn, weight, fRhsSurf, fRhsVol, ndim, polyOrder, numBasis, idx, printWarnings);

  for(int i=0; i<numBasis; i++) {
    fRhsVol[i] *= scaler;
  }

  return scaler;
}
